import React, {useEffect, useRef, useState} from "react";
import Map from "../components/Map";

import { fetchChargers } from "../services/charger/fetchChargersService";
import './ChargersPage.css'

/**
 *
 * Komponenten er siden med ChargerList-komponent.
 * @component
 * @author Magnus
 */

const ChargerMapPage = () => {

    const [chargers, setChargers] = useState([]);

    useEffect(() => {
        let isMounted = true;
        fetchChargers().then(x => {
            if (isMounted) {
                setChargers(x);
            }
        }).catch((error) => {
            console.log(error);
        });
        return () => {
            isMounted = false;
        }
    }, [])

    return (
        <div className="scopeContent">
            <div className="box">
                <Map chargers={chargers}/>
                <div className="mapNavBar">
                    <button className="activeChargerButton">SOMETHINGSOMETHING</button>
                </div>
            </div>
        </div>

    );
}

export default ChargerMapPage;
